import React from 'react'
import { Link } from 'react-router-dom'

class Heading extends React.Component {
    constructor() {
        super()
        this.state = {}
    }

    render(){
        return (
            <div className = "head">
                <div className = "recipesbutton">
                    <h1><Link to = "/" className = "recipes">Recipes</Link></h1>
                </div>
                <div className = "addbutton">
                    <h1><Link to = "/add" className = "addrecipe">Add a Custom Recipe!</Link></h1>
                </div>
                <div className = "buttondiv"><button>Make recipe!</button></div>
            </div>
        )
    }


}

export default Heading
